import React, { FC, useState } from "react";
import "./App.css";
import { UserData } from "./UserData";

const App: FC = () => {
  const [users, setUser] = useState<UserData[]>([
    {
      id: 1,
      email: "lbui21199@gmail.com",
      password: "123456",
      name: "Long",
      sex: "male",
      birthday: new Date(1999-1-2),
      phone: 99999999,
    },
  ]);

  return <></>;
};

export default App;
